directions = [(1, 0), (0, 1), (-1, 0), (0, -1)]


class Solution1(object):
    """
    Details about it's time and space complexity. what makes it a good solution?
    """
    @staticmethod
    def run(grid):
        # first find the two islands and their borders
        m, n = len(grid), len(grid[0])

        def find_new_island(m, n, grid, seen=set()):
            for i in range(m):
                for j in range(n):
                    if grid[i][j] == 1 and (i, j) not in seen:
                        return i, j

        def is_in_border(x, y, grid):
            for i, j in directions:
                if 0 <= x + i < m and 0 <= y + j < n and grid[x + i][y + j] == 0:
                    return True
            return False

        def find_island_border(m, n, grid, a, b):
            stack = [(a, b)]
            border = []
            seen = set()
            while len(stack) != 0:
                x, y = stack.pop()
                if (x, y) in seen:
                    continue

                if is_in_border(x, y, grid):
                    border.append((x, y))
                seen.add((x, y))
                for i, j in directions:
                    if 0 <= x+i < m and 0 <= y+j < n and grid[x+i][y+j] == 1 and (x+i, y+j) not in seen:
                        stack.append((x+i, y+j))

            return border, seen

        a, b = find_new_island(m, n, grid)
        island_1_border, island_1 = find_island_border(m, n, grid, a, b)

        # find other island and find the closest pair of points in the borders (manhattan distance)
        a, b = find_new_island(m, n, grid, island_1)
        island_2_border, island_2 = find_island_border(m, n, grid, a, b)

        def manhattan_distance(p1, p2):
            x1, y1 = p1
            x2, y2 = p2
            return abs(x1 - x2) + abs(y1 - y2)

        min_distance = 2**32
        for p1 in island_1_border:
            for p2 in island_2_border:
                min_distance = min(min_distance, manhattan_distance(p1, p2))
        return min_distance - 1


class Solution2(object):
    """
    Details about it's time and space complexity. what makes it a good solution?
    """
    @staticmethod
    def run(grid):
        # first find the first island and it borders
        m, n = len(grid), len(grid[0])

        def find_island(m, n, grid):
            for i in range(m):
                for j in range(n):
                    if grid[i][j] == 1:
                        return i, j

        def is_in_border(x, y, grid):
            for i, j in directions:
                if 0 <= x + i < m and 0 <= y + j < n and grid[x + i][y + j] == 0:
                    return True
            return False

        def find_island_border(m, n, grid, a, b):
            stack = [(a, b)]
            border = set()
            seen = set()
            while len(stack) != 0:
                x, y = stack.pop()
                if (x, y) in seen:
                    continue

                if is_in_border(x, y, grid):
                    border.add((x, y))
                seen.add((x, y))
                for i, j in directions:
                    if 0 <= x + i < m and 0 <= y + j < n and grid[x + i][y + j] == 1 and (x + i, y + j) not in seen:
                        stack.append((x + i, y + j))

            return seen, border

        a, b = find_island(m, n, grid)
        island, border = find_island_border(m, n, grid, a, b)
        for x, y in island:
            grid[x][y] = '*'

        count = 0
        while True:
            new_border = set()
            for x, y in border:
                for i, j in directions:
                    if 0 <= x + i < m and 0 <= y + j < n:
                        if grid[x+i][y+j] == 1:
                            return count
                        if grid[x+i][y+j] == 0:
                            new_border.add((x+i, y+j))
                    grid[x][y] = '-'
            count += 1
            border = new_border


